import React from 'react'
const FooterElements = ["123 Fake Street, London, E1 4UD", "hello@fakehotel.com", "0123 456789"];
const Footer = () => {

  return(
    <ul>
      {FooterElements.map((element, index) => (
        <li key="index" className="Footer">{element}</li>
      ))}
    </ul>
  )
}
export default Footer;
